INSERT INTO [dbo].[ProcessGroups] ([Id], [CreatedAt], [UpdatedAt], [Deleted], [ProcessGroupNumber], [ProcessGroupText], [ProcessGroupDescription], [PmbokVersionId]) VALUES (N'600480f4c1364c7d9ad114b25560ec91', N'9/25/2018 7:47:42 PM +00:00', N'9/25/2018 7:47:42 PM +00:00', 0, 4, N'Monitoring and Controlling', N'The monitoring and controlling process group consists of those processes required to track, review, and regulate the process and performance of the project, identify any areas in which changes to the plan are required; and initiate corresponding changes.', N'edd7dca4d2a94c7a8d6f55fbef403f8c')
