INSERT INTO [dbo].[ITOes] ([Id], [CreatedAt], [UpdatedAt], [Deleted], [ITOId], [ITOText], [ITODescription], [PmbokVersionId]) VALUES (N'b4f179fdf4974055a16508720cf22812', N'9/25/2018 9:40:27 PM +00:00', N'10/2/2018 5:29:38 PM +00:00', 0, 9, N'Project Management Plan', N'The project management plan incorporates and consolidates all of the subsidiary management plans and baselines from the planning processes. The Project Management plan may include but is not limited to: The life cycle slected for the project and processes that will be applied to each phase. Results of the tailoring by the project management teas as follows: Project management processes selected by the team. Level of implementation of each selected process. Descriptions of the tools and techniques to be used for accomplishing those processes. How the selected processes will be used to manage the specific project. How work will be executed to accomplish the project objectives. A Change Management Plan that documents how changes will be monitored and controlled. A Configuration Management Plan that documents how configuration management will be performed. How integrity of the performance measurement baselines will be maintained. Need and techniques for communication among stakeholders. Key management reviews for content, extent and timing to facilitate addressing open issues and pending decisions.', N'edd7dca4d2a94c7a8d6f55fbef403f8c')
GO
